import React, { useEffect } from "react";
import "./matchSelector.css";
function MatchTypeSelector(props) {
  useEffect(() => {
    const showSMTH = () => {
      const active_register = document.getElementsByClassName(
        "active_register"
      );
      const unactive_register = document.getElementsByClassName(
        "unactive_register"
      )[0];
      if (props.active === "register") {
        unactive_register.style.display = "none";
      }
    };
    showSMTH();
  });
  return (
    <div>
      <br />
      <div className="row" style={{ textDecoration: "underline" }}>
        <div className="col-1"></div>
        <div className="col-5 active_register">
          <h6 className="tab" style={{ paddingBottom: "20px" }}>
            Register Match
          </h6>
        </div>
        <div className="col-5 unactive_register">
          <h6 className="" style={{ paddingBottom: "20px" }}>
            Register Match
          </h6>
        </div>
        <div className="col-2"></div>
        <div className="col-4">
          <h6>Match Stats</h6>
        </div>
        <div className="col-1"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
